import React, { useState } from "react";
import SubmitButton from "../modalcontent/submitbutton";
import "./index.css";

const GridItem = ({
  tabState,
  setTabState,
  itemnum,
  setPreDest,
  setValiTime,
  preDest,
  gridList,
}) => {
  return (
    <div className="gridItem">
      <a href="https://cdn.onepiecechapters.com">
        <img
          onClick={setTabState(6)}
          className="gridImage"
          src="https://cdn.onepiecechapters.com/file/CDN-M-A-N/Screen-Shot-2021-04-23-at-9.31.12-PM-1024x732v3.png"
        />{" "}
      </a>
      <p>{gridList[itemnum].name}</p>
      <p>${gridList[itemnum].price}</p>
      <SubmitButton
        tabState={5}
        setTabState={setTabState}
        itemnum={itemnum}
        setPreDest={setPreDest}
        setValiTime={setValiTime}
        preDest={preDest}
      />
    </div>
  );
};

export default GridItem;
